  "Sanction Details" : "ON 10/20/1998 THE TEXAS SECURITIES COMMISSIONER ENTERED A DISCIPLINARY ORDER REPRIMANDING AND FINING JERRY WAYNE SPINKS FOR FAILURE TO DISCLOSE THE FILING OF A BANKRUPTCY PETITION, AS PURSUANT TO SECTIONS 14.A(6), 14.A(7) AND 23-1 OF THE TEXAS SECURITIES ACT.  A $250 FINE WAS ASSESSED.",
  "Broker Comment" : "PLEASE SEE ATTACHED LETTER: BECAUSE OF A TAKEOVER BY A FIRM THAT ALREADY OWNED US I DID NOT FEEL THAT THERE HAD BEEN A CHANGE IN MY EMPLOYMENT. THEREFORE I DID NOT DISCLOSE THE FILING OF A CHAPTER 13, HOWEVER I DID NOTIFY MY SUPERVISOR. (THAT I CORRECTED).  THE GREAT STATE OF TEXAS FELT THAT THIS MISTAKE SHOULD BE PUNISHED.  SUBSEQUENTLY I WAS FINED 250.00 & REPRIMANDED.  WITHOUT WANTING TO DELAY MY REGISTRATION ANY LONGER, I AGREED TO THE ABOVE AND ADMITTED GUILT TO THE FAILURE TO DISCLOSE."
